    useEffect(() => {
        retrieveQuestion();
      }, []);

    const retrieveQuestion = () => {
    QuestionService.get(id)
        .then(response => {
        console.log(response.data)
        setQuestion(response.data);
        console.log(question)
        })
        .catch(e => {
        console.log(e);
        });

    };

